import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="box">
      <header className="App-header">
        <button>Sign Up</button>
        <button>Log In</button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <h1>WhATS good</h1>
      </header>
      <input class="input" placeholder="First Name*" name="firstname"></input> 
      <input class="input" placeholder="Last Name*" name="lastname"></input><br></br>
      <input class="input" placeholder="Email Adress" name="email"></input> <br></br>
      <input class="input" placeholder="Set A Password*" name="password"></input>
      <button>G</button>
    </div>
  );
}

export default App;
